import React from 'react';

function PDFViewer(currentCard){
  return (
    <div className="PDFLoading">
      <p>{currentCard.name}</p>
      <p>{currentCard.japaneseName}</p>
      <p>{currentCard.age}</p>
      <p>{currentCard.job}</p>
      <p>{currentCard.image}</p>
    </div>
  )
}

export default PDFViewer;
